import React from 'react'
import {Course, CourseHeadline} from "./CourseTileElements"


const CourseTile = ({
    headline
}) => {
    return (
        <Course>
          <CourseHeadline>
              {headline}
            </CourseHeadline> 
        </Course>
    )
}

export default CourseTile
